const cards = [
    {
        id: 'card-1',
        title: 'learning how to cook',
    },
    {
        id: 'card-2',
        title: 'making sandwitch', 
    },
    {
        id: 'card-3',
        title: 'taking the trash out',
    },
];

const data = {
    lists: {
        'list-1': {
            id: 'list-1',
            title: 'Todo',
            cards,

        },
    },
    listIds: ['list-1'],
};

